import React from 'react'   
import './expenses.css'
import NewExpense from './New Expenses/NewExpense'
import ExpenseItem from './ExpenseItem'


const Expenses = (props) => {
  const expenses = [
    {
      id : "e1",
      title : "Shampoo",
      amount : "266",
      date : "2022 2 2"
    },
    {
      id : "e2",
      title : "Soap",
      amount : "209",
      date : "2022 2 2"
    }
  ]
  return (
    <div className='expenses'>
      
    <NewExpense />
    <ExpenseItem date={expenses[0].date.toString} title={expenses[1].title} amount={expenses[1].amount}/>
    </div>
  )
}
export default Expenses
